import React from "react";
import ProjectsContainer from "../ProjectsContainer";

const Project = props =>{
    const {title,desc,skills} = props;
    return(
        <div>
            <span id="title">{title}</span>
            <div>
                <span id="desc">{desc}</span>
                <span id="skills">{skills}</span>
            </div>
        </div>
    );
}

export default Project;
